CREATE DATABASE library;
USE library;

DROP TABLE IF EXISTS `authors`;
CREATE TABLE `authors` (
  `id` int NOT NULL,
  `firstName` varchar(100) DEFAULT NULL,
  `lastName` varchar(100) DEFAULT NULL,
  `expertise` varchar(100) DEFAULT NULL,
  `about` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

LOCK TABLES `authors` WRITE;
INSERT INTO `authors` VALUES (2,'Vũ','Hữu Tiệp','Ngôn ngữ','Là một người giàu ngôn ngữ '),
(3,'Martin ',' Lindstrom','Maketting',''),
(4,'Trần ','Bích Hà','Y học','là một nhà y học tài ba'),
(5,'BOBBY ','BONES','Kĩ năng sống','Ông có rất nhiều câu nói hay về kĩ năng sống'),
(6,'Ngô','Thành Nam','AI','Hơn 10 năm trước - những lập trình viên Việt Nam - tìm mọi cách thuyết phục hãng Boeing để tham gia vào dự án Digital Aviation của họ. Một dự án đầy thách thức.'),(7,'Houbing ','Song','Công nghệ','Là một người giàu kinh nghiệm trong lĩnh vực công nghệ'),(12,'Kevin','Mitnick','Công nghệ','Hồ Anh Thái có lẽ là một trong những tác giả có sức viết dồi dào nhất nền văn học đương đại Việt Nam với tổng cộng 33 cuốn sách. “Hiện tượng văn chương của thế hệ văn nhân thời hậu chiến sau 1975” Hồ Anh Thái bắt đầu sự nghiệp viết lách từ năm 1985, bên cạnh một sự nghiệp khác là nhà ngoại giao và giáo sư văn hóa.'),(984,'Hồ','Hồng Thái','Văn học','Hồ Anh Thái có lẽ là một trong những tác giả có sức viết dồi dào nhất nền văn học đương đại Việt Nam với tổng cộng 33 cuốn sách. “Hiện tượng văn chương của thế hệ văn nhân thời hậu chiến sau 1975” Hồ Anh Thái bắt đầu sự nghiệp viết lách từ năm 1985, bên cạnh một sự nghiệp khác là nhà ngoại giao và giáo sư văn hóa.');
UNLOCK TABLES;


DROP TABLE IF EXISTS `book_genres`;
CREATE TABLE `book_genres` (
  `id` int NOT NULL,
